function calcularDistancia(coord1, coord2) {
    const R = 6371e3; // metros
    const [lat1, lon1] = coord1.map(c => c * Math.PI/180); // converte graus para radianos
    const [lat2, lon2] = coord2.map(c => c * Math.PI/180);
    const deltaLat = lat2 - lat1;
    const deltaLon = lon2 - lon1;

    const a = Math.sin(deltaLat/2) * Math.sin(deltaLat/2) +
            Math.cos(lat1) * Math.cos(lat2) *
            Math.sin(deltaLon/2) * Math.sin(deltaLon/2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));

    return R * c; 
}

async function encontrarParadaMaisProxima(coordenadaUsuario, paradas) {
    let menorDistancia = Infinity;
    let paradaMaisProxima;

    paradas.forEach((parada) => {
        const distanciaAtual = calcularDistancia(coordenadaUsuario, parada.coordenadas);
        if (distanciaAtual < menorDistancia) {
            menorDistancia = distanciaAtual;
            paradaMaisProxima = parada;
        }
    });

    return [paradaMaisProxima['codigo'], paradaMaisProxima['coordenadas']];
}

async function encontrarParadaMaisProximaDestino(coordenadaDestino, paradas) {
    let paradasMaisProximas = [];

    paradas.forEach((parada) => {
        const distanciaAtual = calcularDistancia(coordenadaDestino, parada.coordenadas);
        parada['distancia'] = distanciaAtual;

        if (paradasMaisProximas.length < 7) {
            paradasMaisProximas.push(parada);
        }else{
            
            let indiceMaisDistante = 0;
            let maiorDistancia = paradasMaisProximas[0].distancia;

            for(let i in paradasMaisProximas){

                if (paradasMaisProximas[i].distancia > maiorDistancia) {
                    maiorDistancia = paradasMaisProximas[i].distancia;
                    indiceMaisDistante = i;
                }

            }

            
            if (distanciaAtual < maiorDistancia) {
                paradasMaisProximas[indiceMaisDistante] = parada;
            }
        }
    });

    paradasMaisProximas.sort((a, b) => a.distancia - b.distancia);
    return paradasMaisProximas;
}

